import React from "react";
import styled from "styled-components";
import logo from "../sts.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

// import Logo from "./Logo";
// import Links from "./Links";

const Link = styled.a.attrs({
  className:
    "text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-no-wrap uppercase text-white",
  href: "#",
})``;

const logoStyle = {
  height: "75px",
  width: "75px",
};

const el = <FontAwesomeIcon icon={faBars} />;

export default function NavBar() {
  const [navBarOpen, setNavBarOpen] = React.useState(false);
  return (
    <>
      <nav className="relative flex flex-wrap ites-center justify-between px-2 py-3 navbar-expand-lg bg-red-500 mb-3">
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
            <Link>
              <img src={logo} alt="Logo" style={logoStyle} />
            </Link>
            <button
              className="text-white cursor-pointer text-xl leading-none px-3 py-1 border border-solid border-transparent rounded bg-transparent block lg:hidden outline-none focus:outline-none"
              type="button"
              onClick={() => setNavBarOpen(!navBarOpen)}
            >
              {el}
            </button>
          </div>
        </div>
      </nav>
    </>
  );
}
